import React from 'react';
import { Card, Button } from 'react-bootstrap';

 
function WorkCard(){
		return (
		<>
            <Card>
           
            <Card.Body>
              <Card.Text>
                Some quick example text to build on the card title and make up the bulk
                of the card's content.
              </Card.Text>
            </Card.Body>
          </Card>
     
          
          </>
		
		)
	}


export default WorkCard;
